BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "utilisateurs" (
	"id_user"	INTEGER,
	"nom"	TEXT,
	"prénom"	TEXT,
	"niveau"	VARCHAR(1),
	"mail"	TEXT,
	"mdp"	TEXT,
	PRIMARY KEY("id_user" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "posts" (
	"id_post"	INTEGER,
	"id_sub"	INTEGER,
	"titre"	TEXT,
	"description"	TEXT,
	"posté_par"	INTEGER,
	"date_creation"	DATE,
	"ratio"	INTEGER,
	PRIMARY KEY("id_post" AUTOINCREMENT),
	FOREIGN KEY("id_sub") REFERENCES "subs"("Numéro_projet")
);
CREATE TABLE IF NOT EXISTS "abonnements" (
	"sub"	INTEGER NOT NULL,
	"utilisateur"	INTEGER NOT NULL,
	PRIMARY KEY("sub","utilisateur"),
	FOREIGN KEY("sub") REFERENCES "subs"("numéro_projet"),
	FOREIGN KEY("utilisateur") REFERENCES "utilisateurs"("id_user")
);
CREATE TABLE IF NOT EXISTS "participants" (
	"sub"	INTEGER NOT NULL,
	"utilisateur"	INTEGER NOT NULL,
	PRIMARY KEY("sub","utilisateur"),
	FOREIGN KEY("utilisateur") REFERENCES "utilisateurs"("id_user"),
	FOREIGN KEY("sub") REFERENCES "subs"("numéro_projet")
);
CREATE TABLE IF NOT EXISTS "demande_participation" (
	"sub"	INTEGER NOT NULL,
	"utilisateur"	INTEGER NOT NULL,
	PRIMARY KEY("sub","utilisateur"),
	FOREIGN KEY("sub") REFERENCES "subs"("numéro_projet"),
	FOREIGN KEY("utilisateur") REFERENCES "utilisateurs"("id_user")
);
CREATE TABLE IF NOT EXISTS "commentaires" (
	"id_commentaire"	INTEGER,
	"contenu"	TEXT,
	"posté_par"	INTEGER,
	"id_post"	INTEGER,
	"upvote"	INTEGER,
	PRIMARY KEY("id_commentaire" AUTOINCREMENT),
	FOREIGN KEY("id_post") REFERENCES "posts"("id_post"),
	FOREIGN KEY("posté_par") REFERENCES "utilisateur"("id_user")
);
CREATE TABLE IF NOT EXISTS "Vote_com" (
	"id_vote"	INTEGER NOT NULL UNIQUE,
	"id_voteur"	INTEGER NOT NULL,
	"id_com"	INTEGER NOT NULL,
	"val"	TEXT NOT NULL,
	PRIMARY KEY("id_vote" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "Vote_post" (
	"id_voteur"	INTEGER NOT NULL,
	"id_vote"	INTEGER NOT NULL UNIQUE,
	"id_post"	INTEGER NOT NULL,
	"val"	TEXT NOT NULL,
	PRIMARY KEY("id_vote" AUTOINCREMENT)
);
CREATE TABLE IF NOT EXISTS "chat" (
	"id"	INTEGER,
	"numsub"	INTEGER,
	"id_posteur"	INTEGER,
	"message"	TEXT,
	"date"	DATETIME,
	PRIMARY KEY("id" AUTOINCREMENT),
	FOREIGN KEY("numsub") REFERENCES "subs"("numéro_projet"),
	FOREIGN KEY("id_posteur") REFERENCES "utilisateur"("id_user")
);
CREATE TABLE IF NOT EXISTS "subs" (
	"nom"	TEXT,
	"créé_par"	INTEGER,
	"numéro_projet"	INTEGER,
	"mots_clés"	TEXT,
	"description"	TEXT,
	"création"	DATE,
	PRIMARY KEY("numéro_projet" AUTOINCREMENT),
	FOREIGN KEY("créé_par") REFERENCES "utilisateurs"("id_user")
);
COMMIT;
